import axios from './lib/axios.js';
import React, { useState, useEffect } from 'react';


   function App() {
       const [data, setData] = useState([]);

       useEffect(() => {
           axios.get('/api/comics/')
               .then(response => setData(response.data))
               .catch(error => console.error(error));
       }, []);

       return (
           <div>
               {data.map(item => (
                   <div key={item.id}>
                       {/* Render data here */}
                   </div>
               ))}
           </div>
       );
   }

   export default App;
// This module is intended to unwrap Axios default export as named.
// Keep top-level export same with static properties
// so that it can keep same with es module or cjs
const {
  Axios,
  AxiosError,
  CanceledError,
  isCancel,
  CancelToken,
  VERSION,
  all,
  Cancel,
  isAxiosError,
  spread,
  toFormData,
  AxiosHeaders,
  HttpStatusCode,
  formToJSON,
  getAdapter,
  mergeConfig
} = axios;

export {
  axios as default,
  Axios,
  AxiosError,
  CanceledError,
  isCancel,
  CancelToken,
  VERSION,
  all,
  Cancel,
  isAxiosError,
  spread,
  toFormData,
  AxiosHeaders,
  HttpStatusCode,
  formToJSON,
  getAdapter,
  mergeConfig
}

